import Expenses from "./components/expenses/Expenses.js";
import NewExpense from "./components/NewExpense/NewExpense.js";
import { Helmet } from "react";
function App() {
return(
  <div>
    <Helmet>
      <title>Expenses Manager</title>
    </Helmet>
  <NewExpense></NewExpense>
  <Expenses></Expenses>
  </div>
);
}

export default App;
